var array = (function() {
    function array(data) {
        this.data = data;
    }
    array.prototype.count = function() {
        var maping = this.data.reduce(function(a, b) {
            a[b] = (a[b] || 0) + 1;
            return a;
        }, {});
        return maping;
    };
    return array;
}());
module.exports = array;